import { useState } from "react";
import "./reg.css"


const Register = () => {
    const [status, setStatus] = useState("Submit");
    const handleSubmit = async (e) => {
      e.preventDefault();
      setStatus("Sending...");
      const { name, email, message } = e.target.elements;
      let details = {
        name: name.value,
        email: email.value,
        message: message.value,
      };
      let response = await fetch("http://localhost:3000/register", {
        method: "POST",
        headers: {
          "Content-Type": "application/json;charset=utf-8",
        },
        body: JSON.stringify(details),
      });
      setStatus("Submit");
      let result = await response.json();
      alert(result.status);
    };
    return (
        <div className="op">
            <div style="width:100%;height:0;padding-bottom:100%;position:relative;"><iframe src="https://giphy.com/embed/3oz8xus1ykCFgxW2ac" width="100%" height="100%" style="position:absolute" frameBorder="0" class="giphy-embed" allowFullScreen></iframe></div><p><a href="https://giphy.com/gifs/trippy-abstract-pi-slices-3oz8xus1ykCFgxW2ac">via GIPHY</a></p>
            <h1>Register For More...</h1>
      <form onSubmit={handleSubmit} id="dsa">
        <div className="sq">
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" required />
        </div>
        <div className="sq">
          <label htmlFor="email">Email:</label>
          <input type="email" id="email" required />
        </div>
        <div className="sq">
          <label htmlFor="message">Message:</label>
          <textarea id="message" required />
        </div>
        <button type="submit">{status}</button>
      </form>
      </div>
    );
  };

  export default Register;
